import React from "react";

const AccommodationTerm = (props) =>{
    return (
        <tr>
            <td scope={"col"}>{props.term.name}</td>
            <td scope={"col"}>{props.term.category}</td>
            <td scope={"col"}>{props.term.numRooms}</td>
            <td scope={"col"} className={"text-right"}>
                <a title={"Delete"} className={"btn btn-danger"}
                   onClick={() => props.onDelete(props.term.id)}>Delete</a>
                <a title={"Edit"} className={"btn btn-danger"}
                   onClick={() => props.onEdit(props.term.id)} href={`/accommodation/edit/`}>Edit</a>
            </td>
        </tr>
    )
}
export default AccommodationTerm;
